(() => {
    const grid = [
        // [1, 2, 3],
        // [4, 5, 6],
        // [7, 8, 9]
        [0, 0, 1, 0, 0],
        [0, 2, 3, 4, 0],
        [5, 6, 7, 8, 9],
        [0, "A", "B", "C", 0],
        [0, 0, "D", 0, 0]
    ];
    const input = `







`;

    let history = [];
    let position = [1, 1];

    for (const line of input.trim().split(/\r|\n/g)) {
        console.log(line);
        for (const direction of line) {
            let candidate = position.slice();

            switch (direction) {
                case "U":
                    candidate[0] += -1;
                    break;

                case "R":
                    candidate[1] += 1;
                    break;

                case "D":
                    candidate[0] += 1;
                    break;

                case "L":
                    candidate[1] += -1;
                    break;
            }

            if (grid[candidate[0]] && grid[candidate[0]][candidate[1]]) {
                position = candidate;
            }
        }

        history.push(grid[position[0]][position[1]]);
    }

    console.log(history.join(""));
})();
